webpackJsonp([0x287707b0188b7000],{"./node_modules/json-loader/index.js!./.cache/json/miscellaneous-what-is-gitter.json":function(e,t){e.exports={data:{markdownRemark:{html:"<h1>Gitter is a chat room system popular with open source projects.</h1>\n<p><img src=\"//discourse-user-assets.s3.amazonaws.com/original/2X/9/901b6ff18a83b746b1b7e96cb6907440d531d977.png\" alt=\"A screenshot from Gitter\"></p>\n<p><a href='https://gitter.im' target='_blank' rel='nofollow'>Gitter.im</a> is a rapidly growing startup based in London.</p>\n<p>Free Code Camp has hundreds of Gitter rooms. These are accessible through Gitter’s website, as well as <a href='https://gitter.im/apps' target='_blank' rel='nofollow'>desktop and mobile apps</a>.</p>\n<p>You can view <a href='https://github.com/FreeCodeCamp/FreeCodeCamp/wiki/Official-Free-Code-Camp-Chat-Rooms' target='_blank' rel='nofollow'>all of our rooms</a> and join the ones you’d like to.</p>\n<p>Gitter allows you to share <a href='https://github.com/FreeCodeCamp/freecodecamp/wiki/Pasting-Code-in-Gitter' target='_blank' rel='nofollow'>formatted code</a> with fellow campers.</p>",fields:{slug:"/miscellaneous/what-is-gitter/"},frontmatter:{title:"What Is Gitter"}}},pathContext:{slug:"/miscellaneous/what-is-gitter/"}}}});
